const intitialState = [
  {
    id: 0,
    name: "Acha Rha'ah",
    number: 75893583,
    email: "ar@g.com",
  },
  {
    id: 1,
    name: "Kah Sama",
    number: 235323232,
    email: "ks@g.com",
  },
];
const contactReducer = (state = intitialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
export default contactReducer;
